package search_test

import (
	"testing"

	"github.com/jbrough/leucine/search"
)

var (
	spike = []byte("")
)

func TestSasaSeqIndex(t *testing.T) {
	sidx, err := search.LoadSasas("../sasa/")
	if err != nil {
		t.Fatal(err)
	}

	_ = sidx
	for _, word := range search.Words(spike, 20) {
		_ = word
	}
}
